import React, { createContext } from "react";

export const NagivationsArray = createContext([]);

export const NagivationsPro = (props) => {
  const [navigation, setNavigations] = React.useState([
    { title: "التسجيل", path: "/" },
    { title: "تسجيل الدخول", path: "/login" },
    { title: "إعلانات الإدارة", path: "/posts" },
    { title: "الدعم الفني", path: "/" },
  ]);
  return (
    <NagivationsArray.Provider value={{ navigation, setNavigations }}>
      {props.children}
    </NagivationsArray.Provider>
  );
};
